import React from "react";
import styled from "styled-components";

const Container = styled.div``;

function FindMyTeam() {
  return (
    <Container>
      <div>
        <div>
          <h1>Looking for Your Team?</h1>
        </div>
      </div>
      <div>How Do Team Invitations Work?</div>
    </Container>
  );
}

export default FindMyTeam;
